const Reducer = (state, action) => {
	switch (action.type) {
		case 'ALREADY LOGIN':
			const newState = { isLogin: true }
			return newState
		case 'ALREADY LOGOUT':
			const newState2 = { isLogin: false }
			return newState2
		default:
			return state
	}
}
export default Reducer
